        <b>Número DNI: </b> {documento[4]} <br/> 
        <b>Ejemplar: </b> {documento[5]} <br/>
        <b>Nacimiento: </b> {documento[6]} <br/>
        <b>Fecha de emisión: </b>{documento[7]} <br/>
